import React from 'react';
import { Box, Heading, Text } from '@chakra-ui/core';

const CharacterItem = props => {
  const { name } = props;

  return (
    <Box mb={2} p={5} shadow="md" borderWidth="1px">
      <Heading fontSize="xl">{name}</Heading>
      {/* <Text mt={4}>{desc}</Text> */}
    </Box>
  );
};

export default CharacterItem;
